import React from 'react';

function App() {
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>横浜ポスター管理システム</h1>
      <p>React アプリが正常に起動しました！</p>
    </div>
  );
}

export default App;
